import React from "react";
<link
  href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css"
  rel="stylesheet"
  integrity="sha384-T3c6CoIi6uLrA9TneNEoa7RxnatzjcDSCmG1MXxSR1GAsXEV/Dwwykc2MPK8M2HN"
  crossorigin="anonymous"
></link>;

const ContactusCard = (el) => {
  console.log(el + "data");
  return (
    <div>
      {/* <div className="card" style={{ width: "18rem" }}>
        <div className="card-body">
          <h5 className="card-title">{el.Name}</h5>
          <h6 className="card-subtitle mb-2 text-muted">el.Email</h6>
          <p className="card-text">{el.Message}</p>
        </div>
      </div> */}
      <div class="card text-white bg-primary mb-3" style="max-width: 18rem;">
        <div class="card-header">{el.Name}</div>
        <div class="card-body">
          <h5 class="card-title">{el.Email}</h5>
          <p class="card-text">{el.Message}</p>
        </div>
      </div>
    </div>
  );
};

export default ContactusCard;
